import React from "react";

function Square({value}) {
  return <button className="square">{value}</button>;
}

export default function Board () {
  return (
    <>
      <div className="board-row">
        <Square value="1"/>
        <Square value="2"/>
        <Square value="3"/>
      </div>
      <div className="board-row">
      <Square value="4"/>
      <Square value=""/>
      <Square />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}
